    const [users, setUsers] = useState()
    const token = localStorage.getItem('token')
    axios.get('https://secopsapi.herokuapp.com/api/users', {headers: {authorization: `Bearer ${token}`}}).then((res) => {
        return res.data.message
    }).then((users) => {
        console.log(users)

    })

    
}

